  \"2016-04-02T16:32:48.829646\",\n\t\"name\": \"national-land-cover-data-199231b05\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NLCD 92 (National Land Cover Dataset 1992)
  is a 21-category land cover classification scheme that has been applied consistently
  over the conterminous U.S. It is based primarily on the unsupervised classification
  of Landsat TM (Thematic Mapper) 1992 imagery. Ancillary data sources included topography,
  census, agricultural statistics, soil characteristics, other land cover maps, and
  wetlands data. The NLCD 92 classification is provided as raster data with a spatial
  resolution of 30 meters.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
